import React from "react";
import "./formPage.styles.scss";
const FormPage = () => {
	return (
		<div className="form-page">
			<div className="topbar-menu">
				<ul>
					<li>Add</li>
					<li>Edit</li>
					<li>Delete</li>
					<li>Update</li>
					<li>Search</li>
					<li>Close</li>
				</ul>
			</div>
		</div>
	);
};

export default FormPage;
